import { Link, Route, Routes } from "react-router-dom";
import "./App.css";
import List from "./components/List/List";
import Login from "./components/Login/Login";
import NavBar from "./components/NavBar/NavBar";
import ListBlog from "./components/Blog/ListBlog";
import SignUp from "./components/SignUp/SignUp";
import Dashboard from "./components/Dashborad/Dashboard";
import Contact from "./components/Contact/Contact";
import PrivateRoute from "./components/PrivateRoute";

function App() {
  return (
    <div>
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <NavBar />
              <List />
            </div>
          }
        />
        <Route
          path="/Home"
          element={
            <div>
              <NavBar />
              <List />
            </div>
          }
        />

        <Route
          path="/login"
          element={
            <div>
              <NavBar />
              <Login />
            </div>
          }
        />
        <Route
          path="/register"
          element={
            <div>
              <NavBar />
              <SignUp />
            </div>
          }
        />
        <Route
          path="/blog"
          element={
            <div>
              <NavBar />
              <ListBlog />
            </div>
          }
        />
        <Route
          path="/contact"
          element={
            <div>
              <NavBar />
              <Contact />
            </div>
          }
        />
        <Route
          path="/dashboard"
          element={
            <div>
              {localStorage.getItem("token") && <Link to="/dashboard"></Link>}
            </div>
          }
        />

        <Route
          path="/dashboard"
          element={
            <PrivateRoute>
              {" "}
              <Dashboard />{" "}
            </PrivateRoute>
          }
        />
      </Routes>
    </div>
  );
}

export default App;
